hn Wayne, lo sabe. \nEntre medias aparece Colorado, un joven y astuto pistolero, que al principio no quiere saber nada de esta sentencia de muerte pero al final se une supongo que o por pena, o por asuntos propios ( me recuerda much\u00edsimo a Andy Garc\u00eda en \u201cLos Intocables\u201d qu\u00e9 quer\u00e9is que os diga\u2026\ud83e\udd2fy cuando Kevin Costner termina de reclutar a su equipo )\nEsta vez he averiguado algo m\u00e1s ( o veo d\u00f3nde no hay ) y creo de verdad que esta es la magia del cine. Este sheriff no solo es alguien leal que cuida a sus amigos. Yo creo que John Wayne es un nost\u00e1lgico, y quiere volver a presenciar un tiroteo con Dean Martin como los de antes, cuando su compa\u00f1ero le cubr\u00eda a la vez que se libraba de cuatro. \nA m\u00ed tambi\u00e9n ahora mismo me han entrado ganas de viajar a Estados Unidos para ver lo que ha quedado de Rio Bravo y ver si huele a \u201coeste\u201d.\n\n\ud83d\udc57 @daradetomas \n\ud83d\udcf7 @myriam.escudero \n\ud83d\udc84 @redlipsandchocolate \n\nAbout last night\u2026watching movies\ud83c\udfac\n\n#watchingmovies #pelis #western #oeste #movies #instamovie #cowboys #johnwayne #lealtad #movistar"}}]},"shortcode":"Cf4OMZGDJRC","edge_media_to_comment":{"count":1},"taken_at_timestamp":1657556411,"dimensions":{"height":1245,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/292444790_737340100839732_1875764693849768393_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=zbRddUn6bAgAX8M9uXj\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9neDCo_1NpMNp6quDvVTAj7s4R5ea-W9lsA1I5Lx4sCg\u0026oe=62D2FB5C\u0026_nc_sid=4efc9f","edge_liked_by":{"count":5},"edge_media_preview_like":{"count":5},"owner":{"id":"9973028033"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/292444790_737340100839732_1875764693849768393_n.jpg?stp=c0.70.918.918a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026