2_4752565501511543_9000332274149240081_n.webp?stp=c257.0.566.566a_dst-jpg_e35_s480x480\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=111\u0026_nc_ohc=FmJIN8d4SWkAX_QakUC\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-1WEL5TIx4XYnNxRexolNo2OvVa8QVKSAlKnB63oBHYA\u0026oe=62D2F8BA\u0026_nc_sid=4efc9f","config_width":480,"config_height":480},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/292685092_4752565501511543_9000332274149240081_n.webp?stp=c257.0.566.566a_dst-jpg_e35\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=111\u0026_nc_ohc=FmJIN8d4SWkAX_QakUC\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8lMzofrhaTFGCtkOaBeDp3jnuo3pgkc-bWHUauNKoFIQ\u0026oe=62D2F8BA\u0026_nc_sid=4efc9f","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":null}},{"node":{"comments_disabled":false,"__typename":"GraphImage","id":"2880112650123512975","edge_media_to_caption":{"edges":[{"node":{"text":"MOVIE REVIEW: 8.7/10 \u201cAUSTIN BUTLER HAS ENTERED THE BUILDING!\u201d\nAfter seeing this movie, I completely understand how Austin Butler would naturally slip into Elvis mode while doing interviews. The connection he had to this role could be heard through his performance, strongly felt, and undeniably seen from the first appearance of his iconic \u201cwiggle\u201d dance move. Butler not only had charisma when he was singing, but you could tell that he really threw all of his soul into this performance. I loved that this movie was set against the backdrop of the evolving cultural landscape, as Elvis is such an icon it\u2019s hard to imagine him living through those turbulent times of the 50\u2019s and 60\u2019s. Equally as lost in his role was Tom Hanks as Elvis\u2019 manager Colonel Tom Parker. Before seeing Elvis I would have told you it\u2019s physically impossible to hate Tom Hanks, but man did he knock this out of the park. Our only complaint, and this comes with the nature of any biopic, is the length. As the end of Elvis\u2019 life was incredibly heartbreaking, you almost wish you could\u2019ve skipped over some of those parts. One of the most shocking revelations of this film was Elvis telling Priscilla that no one will remember him after he\u2019s gone\u2026if he could only this now.\n\u201cWHEN THINGS ARE TOO DANGEROUS TO SAY, SING.\u201d\n#FlicksAndFlix @flicksandflix #MovieReview \ud83c\udf7f\n#Elvis #ElvisMovie @elvismovie\n#AustinButler as #ElvisPresley\n#TomHanks as Colonel #TomParker\n#OliviaDeJonge as #PriscillaPresley\n#YolaQuartey as Sister Rosetta Tharpe\n#LukeBracey as Jerry Schilling\n#KelvinHarrisonJr as #BBKing\n#DacreMontgomery as Steve Binder\nWriter, Producer, \u0026 Director: #BazLuhrmann @bazluhrmann \ud83c\udfa5\ud83d\udd8a\nStudio: #WarnerBrothers @wbpictures \ud83c\udf9e\n#Musicals #Musical #RockAndRoll #Music #Drama #Biopics #Biopic #Movies #Movie #Reviews #Review"}}]},"shortcode":"Cf4NzIfuIyP","edge_media_to_comment":{"count":1},"taken_at_timestamp":1657556204,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/293183793_1448682142238530_3127403623311975567_n.jpg?stp=dst-jpg_e35_s1080x1080\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=fljjMT12b0AAX87Vl7N\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8iZm8Pqs936okVPEEn9_TPM--svwXs0gFUpSJlUbdmgg\u0026oe=62D34ED1\u0026_nc_sid=4efc9f","edge_liked_by":{"count":3},"edge_media_preview_like":{"count":3},"owner":{"id":"7975023046"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/293183793_1448682142238530_3127403623311975567_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=fljjMT12b0AAX87Vl7N\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-XbU5ABzn78s_G95vADy6dbUPVwfZ8Uv0YC3LAtHORmg\u0026oe=62D34ED1\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/293183793_1448682142238530_312740362331