 course first appeared in  Dr No (1962). \ud83c\udfbc \n\nBond producer Cubby Broccoli has asked Norman to compose the first movie's score, having been impressed with his stage musical CV.\n\n\"His sexiness, his mystery, his ruthlessness - it's all there in a few notes.,\" he later recalled.\n\nRIP -Our thoughts are with his family \u0026 friends at this tough time. \n.\n.\n#JamesBond #007 #Bond #jamesbond007 #007jamesbond #BondJamesBond #MontyNorman #composer #ThemeMusic #British #Classic #Legend #Movies #Film #FilmMusic #Cinema #Sounds #RIP #BreakingNews"}}]},"shortcode":"Cf4GGzIM2n_","edge_media_to_comment":{"count":5},"taken_at_timestamp":1657552171,"dimensions":{"height":867,"width":750},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/292665505_466771878626144_5226239136879986711_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=XPySXSoCgw8AX-ucJGY\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_DmETAmD60Cw6ZV_nJn4oAIMSQUGqlKjwvQVu9x3b09g\u0026oe=62D40231\u0026_nc_sid=4efc9f","edge_liked_by":{"count":135},"edge_media_preview_like":{"count":135},"owner":{"id":"5461318922"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/292665505_466771878626144_5226239136879986711_n.jpg?stp=c0.51.653.653a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=XPySXSoCgw8AX-ucJGY\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT95jIFkCgXbU8KjfAQ1LHUoGRkQZhhHDgyVuILHDg477A\u0026oe=62D40231\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/292665505_466771878626144_5226239136879986711_n.jpg?stp=c0.51.653.653a_dst-jpg_e35_s150x150\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=XPySXSoCgw8AX-ucJGY\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-Ha6gCbPpQ_kMhGNStD3TZ5-rOY8n-glQmN2i8IS4uVg\u0026oe=62D40231\u0026_nc_sid=4efc9f","config_width":150,"config_height":150},{