onfig_width":240,"config_height":373},{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/292759760_1241962279968264_2877712630588901747_n.jpg?stp=dst-jpg_e15_p320x320\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=Q2luAoe6DFUAX-21APZ\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-d9DaFoffx3WVzp8tve4X6yIe-agNzrA88VGEZ-gF-9A\u0026oe=62CEE5C5\u0026_nc_sid=4efc9f","config_width":320,"config_height":497},{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/292759760_1241962279968264_2877712630588901747_n.jpg?stp=dst-jpg_e15_p480x480\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=Q2luAoe6DFUAX-21APZ\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT83CiK_c0OUmhSmcXObKwhVQnKJjUGD0ZbxVuzsIB2Mdw\u0026oe=62CEE5C5\u0026_nc_sid=4efc9f","config_width":480,"config_height":746},{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/292759760_1241962279968264_2877712630588901747_n.jpg?stp=dst-jpg_e15\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=Q2luAoe6DFUAX-21APZ\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT87S22aELVy-avoaYcS3NxWYNFZN0VCA9y_ydgV934kLw\u0026oe=62CEE5C5\u0026_nc_sid=4efc9f","config_width":640,"config_height":995}],"is_video":true,"accessibility_caption":null,"product_type":"igtv","video_view_count":1007}},{"node":{"__typename":"GraphSidecar","id":"2879979262272199115","edge_media_to_caption":{"edges":[{"node":{"text":"Signs From The Road::Gene Theatre\n\u2026\nI have photographed countless dozens of #vintage theatres across the US. They are among my favorites, in part because of their being a shrine unto the arts, but also an indicator of a town\u2019s former size and good taste. The vast majority have a very similar marquee, usually a \u201cV\u201d or a flat trapezoid with the facade of the building forming the base. The buildings differ, but the signage is a lot alike.\n\u2026\nBut the Gene Theatre in McRare Georgia is certainly the most unique theatre I have photographed. Opened in May 1951, it honored Eugene Talmadge, former Governor of the state in the 1930s and 1940s. Talmadage hailed from Telfair County, where McRare is the Seat. With 750 seats, it was more than enough for this small berg. It featured movies into the 1970s, and then hosted pageants, craft shows, and performances until 2005, when it closed for good. Contemporary architect Bernard Webb, Jr., is responsible for the mid-mod look and feel.\n\u2026\nThe Georgia Trust for Historic Preservation now lists the Gene as a \u201cPlace in Peril.\u201d The leaky roof is furthering deterioration of the structure, and current property owners have neither plans nor funds to preserve this gem.\n\u2026\nCheck out what this place looked like 71 years ago! VanishingGeorgia.com has this historic photo. I can only imagine theatre goers being blinded by that plaid! This is why we need to preserve our theatre history. Take that, suburban multiplexes.\n\u2026\n#neon #signs #retro #SignsFromTheRoad #everything_signage #roadside #americana  #photography #Sony #camera #Gene #Theatre #Theater #cinematreasures #McRae #Georgia #movies"}}]},"shortcode":"Cf3veFYOdnL","edge_media_to_comment":{"count":6},"taken_at_timestamp":1657540303,"dimensions":{"height":810,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/292734020_452155366383909_2507013390063468343_n.jpg?stp=dst-jpg_e35_s1080x1080\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=FQz7cLqbWBMAX9wQROr\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_ibpaP95hvaEwvqMqcqdYGHTD5TyKBwhtUm0HIlK-IFg\u0026oe=62D2CB2B\u0026_nc_sid=4efc9f","edge_liked_by":{"count":222},"edge_media_preview_like":{"count":222},"owner":{"id":"1014649"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/292734020_452155366383909_2507013390063468343_n.jpg?stp=c180.0.1080.1080a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=F